    backgroundColor: 'grey'
}

function CardBox(){
    return(
        <Fragment>
            <Container
                maxWidth="md"
                sx={{
                    alignItems: 'center',
                    border: '1px solid black',
                    backgroundColor: config.backgroundColor

                }}
            >
                <Card
                    sx={{
                        width:200,
                        height:200,
                        m: 2
                    }}
                >
                    Card Content
                </Card>
            </Container>
        </Fragment>
    )
}

export default CardBox;
